import React from "react";

const Slide = (props) => {
  return (
    <div
      style={
        ({ height: "500px" },
        { width: "900px" },
        { backgroundImage: `url(${content})` },
        { backgroundSize: "cover" },
        { backgroundRepeat: "no-repeat" },
        { backgroundPosition: "center" })
      }
    ><img src={content} /></div>
  );
};

export default Slide;
